import React, { useEffect, useState, useCallback } from "react";
import './channel_page.css';
import logo from './assets/logo2movfara2.png';
import { useNavigate } from 'react-router-dom';

function ChannelPage() {
  const [user, setUser] = useState(null); // Se va actualiza cu detaliile utilizatorului
  const navigate = useNavigate();

  // Funcția pentru a adresa login-ul și a obține datele utilizatorului
  const fetchUserDetails = useCallback(async () => {
    const token = localStorage.getItem("token");

    if (!token) {
      alert("You are not logged in!");
      navigate("/login");
      return;
    }

    try {
      const response = await fetch("http://localhost:5000/user-details", {
        method: "GET",
        headers: {
          "Authorization": `Bearer ${token}`,
          "Content-Type": "application/json",
        },
      });

      if (response.ok) {
        const data = await response.json();
        setUser(data); // Setăm detaliile utilizatorului
      } else {
        const error = await response.json();
        alert(error.message || "Failed to fetch user details");
        navigate("/login");
      }
    } catch (error) {
      console.error("Error fetching user details:", error);
      alert("An error occurred while fetching user details.");
      navigate("/login");
    }
  }, [navigate]);


  // Folosim useEffect pentru a încărca datele la montarea paginii
  useEffect(() => {
    fetchUserDetails();
  }, [fetchUserDetails]);

  // Dacă user este null, înseamnă că detaliile nu sunt încă încărcate
  return (
    <div className="youtube-page">
      {/* Sidebar container including logo */}
      <div className="sidebar-container">
        <div className="logo-container">
          <img src={logo} alt="Logo" className="logo" />
          <span className="logo-text">TUBIFY</span>
        </div>
        <div className="sidebar">
          <ul className="menu">
            <li className="menu-item">Home</li>
            <li className="menu-item">Search</li>
            <li className="menu-item">Top Videos</li>
            <li className="menu-item">Account</li>
            <li className="menu-item">Settings</li>
          </ul>
        </div>
      </div>

      {/* Main Content */}
      <main className="content">
        <div className="channel-info">
          {/* Afișăm detaliile utilizatorului imediat ce acestea sunt disponibile */}
          {user ? (
            <>
              <div className="profile-pic">{user.username[0]}</div>
              <div className="channel-details">
                <h2>{user.username}</h2>
                <p>{user.email}</p>
                <div className="buttons">
                  <button onClick={() => alert('Personalizează canalul')}>
                    Personalizează canalul
                  </button>
                  <button onClick={() => alert('Gestionează videoclipurile')}>
                    Gestionează videoclipurile
                  </button>
                  <button onClick={() => {
                    localStorage.removeItem("token");
                    navigate("/login");
                  }}>
                    Logout
                  </button>
                </div>
              </div>
            </>
          ) : (
            <div>Loading...</div> // Arată un mesaj de încărcare dacă utilizatorul nu este încă încărcat
          )}
        </div>

        <div className="videos">
          <h3>Videoclipuri</h3>
          <div className="video-card">
            <img
              src="https://via.placeholder.com/300x150"
              alt="Videoclip"
              className="video-thumbnail"
            />
            <div className="video-info">
              <h4>
                COLEGIUL NAȚIONAL "ALEXANDRU VLAHUȚĂ" - PROMOȚIA 2019-2020
              </h4>
              <p>901 vizionări · acum 1 an</p>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
}

export default ChannelPage;
